       <>
       <div className='cards'>
           <div className='card'>
                <img href='' src="" alt={props.imgsrc}/>
                <div className='details'>
                   <span>Name :<a href='props.Nlink'>{props.name}</a> <br/>
                   address :<a href=''>Deoghar</a>
                   </span>
                </div>
                <button>click here</button>
                <br/>
           </div>
       </div><br/>
   </>
   );
}

export default Card;
